  const USERS_URL = "https://jsonplaceholder.typicode.com/users";
  const POSTS_URL = "https://jsonplaceholder.typicode.com/posts";

  useEffect(() => {
    axios
      .get(USERS_URL)
      .then((response) => setUsersData(response))

  }, []);

  return (
    <div>
      {usersData.map((user) => {
        <User id={user.id} name={user.name} />;
      })}
    </div>
  );
}
